Notwithstanding the foregoing, to the extent that the Services to be provided with respect to any Account which is registered as an investment company under the 1940 Act (herein referred to as a “registered investment company”) are services referred to in the definition of “investment advisor” under Section 202(a)(11) of the Investment Company Act of 1940 (herein referred to as “investment advisory services”), then with respect to such Account, this Agreement: 

(i) shall not commence until the effective date of its approval by the board of directors or trustees (“Board”) of such Account; 

(ii) shall continue from year to year thereafter, subject to the provisions for termination and all other terms and conditions hereof, only if such continuation shall be specifically approved at least annually by a majority of the Board, including a majority of the members of the Board who are not parties to this Agreement or interested persons of any such party (other than as members of the Board) cast in person at a meeting called for that purpose; 

(iii) may be terminated at any time without the payment of any penalty by the Board or by a vote of a majority of the outstanding voting securities (as defined in Section 2(a)(42) of the 1940 Act) of the Account on 60 days’ written notice to the Adviser; 

(iv) shall automatically terminate in the event of (A) its assignment (as defined in the 1940 Act) or (B) termination of the Advisory Agreement for any reason whatsoever. (Page 2)

If you have transferred your Interests in violation of this Agreement you shall be considered in breach of this Agreement. (Page 38)

Any Transfer that is made without our approval will constitute a breach of this Agreement and convey no rights to or interests in this Agreement, you, the Franchise, or any other The Joint Corp. franchise. (Page 39)

If you propose to Transfer this Agreement, the Franchise or its assets, or any Interest, or if any of your Principal Owners proposes to Transfer a controlling Interest in you or make a Transfer that is one of a series of Transfers which taken together would constitute the Transfer of a controlling Interest in you, then all of the following conditions must be met before or at the time of the Transfer:   (a) the Proposed New Owner must have sufficient business experience, aptitude, and financial resources to operate the Franchise;   (b) you must pay any amounts owed for purchases from us and our affiliates, and any other amounts owed to us or our affiliates which are unpaid;   (c) the Proposed New Owner’s directors and such other personnel as we may designate must have successfully completed our Initial Training program, and shall be legally authorized and have all licenses necessary to perform the services offered by the Franchise. The Proposed New Owner shall be responsible for any wages and compensation owed to, and the travel and living expenses (including all transportation costs, room, board and meals) incurred by, the attendees who attend the Initial Training program;   (d) if your lease for the Premises requires it, the lessor must have consented to the assignment of the lease of the Premises to the Proposed New Owner;   (e) you (or the Proposed New Owner) must pay us a Transfer fee equal to seventy-five percent (75%) of the then current initial franchise fee we charge to new Start-up Location franchisees, and must reimburse us for any reasonable expenses incurred by us in investigating and processing any Proposed New Owner where the Transfer is not consummated for any reason;   (f) you and your Principal Owners and your and their spouses must execute a general release (in a form satisfactory to us) of any and all claims you and/or they may have against us, our affiliates, and our and our affiliates’ respective officers, directors, employees, and agents; 
<omitted>
(g) we must approve the material terms and conditions of the proposed Transfer, including without limitation that the price and terms of payment are not so burdensome as to adversely affect the operation of the Franchise; 
(h) the Franchise and the Premises shall have been placed in an attractive, neat and sanitary condition; 
(i) you and your Principal Owners must enter into an agreement with us providing that all obligations of the Proposed New Owner to make installment payments of the purchase price (and any interest on it) to you or your Principal Owners will be subordinate to the obligations of theProposed New Owner to pay any amounts payable under this Agreement or any new Franchise Agreement that we may require the Proposed NewOwner to sign in connection with the Transfer;
(j) you and your Principal Owners must enter into a non-competition agreement wherein you agree not to engage in a competitive business for a period of two (2) years after the Transfer and within twenty-five (25) miles of your Franchise Premises or any other The Joint Corp. Location franchise location;
(k) the Franchise shall have been determined by us to contain all equipment and fixtures in good working condition, as were required at the initial opening of the Franchise. The Proposed New Owner shall have agreed, in writing, to make such reasonable capital expenditures to remodel, equip, modernize and redecorate the interior and exterior of the premises in accordance with our then existing plans and specifications for a TheJoint Corp. Location franchise, and shall have agreed to pay our expenses for plan preparation or review, and site inspection;
(l) upon receiving our consent for the Transfer or sale of the Franchise, the Proposed New Owner shall agree to assume all of your obligations under this Agreement in a form acceptable to us, or, at our option, shall agree to execute a new Franchise Agreement with us in the form then being used by us. We may, at our option, require that you guarantee the performance, and obligations of the Proposed New Owner; and
(m) you must have properly offered us the opportunity to exercise our right of first refusal as described below, and we must have then declined to exercise it. (Page 40)

However, no assignment shall be effective until such time as Franchisor or its designated affiliate gives Lessor written notice of its acceptance of the assignment, and nothing contained herein or in any other document shall constitute Franchisor or its designated subsidiary or affiliate a party to the Lease Agreement, or guarantor thereof, and shall not create any liability or obligation of Franchisor or its parent unless and until the Lease Agreement is assigned to, and accepted in writing by, Franchisor or its parent, subsidiary or affiliate. (Page 57)

Such records shall be made available for reasonable review, audit and inspection upon reasonable notice and with reasonable frequency, upon SutroVax’s request for the purpose of verifying Sutro’s calculations of amounts due hereunder, the basis for such calculations (including Sutro’s calculation of the Fully Burdened Manufacturing Costs) or payments and Sutro’s compliance with the terms and conditions of this Supply Agreement. (Page 14)

During the Term and the [***] period thereafter, SutroVax or a SutroVax Affiliate may, during normal working hours and upon reasonable advance notice perform site audits and inspect, or request information relating to, Sutro’s or its subcontractor’s Facilities and records directly or indirectly involved in the performance of this Supply Agreement or related to the Product(s). Such requests should be made in writing and Sutro will allow for such audits or inspection to occur within [***] days from request (excepting for cause audits) for Sutro’s Facilities and within [***] days’ from request (excepting for cause audits) for Sutro’s subcontractor’s facilities. Reasonable advance notice for audits for cause shall not require more than [***] advance notice. (Page 16)

During such an inspection or request for information the inspectors may inquire about the progress of the work being carried out by Sutro or its subcontractor, and are in particular but not exclusively authorized to: 

5.1.1 Inspect the Facilities, documents and equipment used, or to be used, in the Manufacture of the Product(s); 

5.1.2 Verify the qualifications of the employees and subcontractors carrying out such work and their use of the relevant equipment;


5.1.3 Evaluate all scientific techniques used by Sutro, its subcontractors and their respective employees in the performance of this Supply Agreement and the procedures used in the creation and storage of samples of the Product(s), provided that nothing in this Section 5.1.3 shall require Sutroto disclose any Sutro Core Know-How; 

5.1.4 Verify and evaluate information relating to the utilization of the Manufacturing capacity of Sutro’s Facilities or its subcontractor’s Facilities; 

5.1.5 Review correspondence, reports, filings and other documents from Regulatory Authorities to the extent related to the Manufacturing activities hereunder; 

5.1.6 Evaluate the implementation of all Manufacturing and process changes made with respect to the Product, including pursuant to any corrective action plan; and 

5.1.7 Ascertain compliance with Applicable Laws, the Specifications and this Supply Agreement. (Pages 16-17)

Without limiting the foregoing; Sutro is responsible for auditing the facilities of the suppliers of Components, if any, periodically, and Sutro agrees to provide SutroVax, upon SutroVax’s request with a current copy of the audit report of such facilities and to incorporate SutroVax’s comments with respect to any corrective action plan related to the Product. (Page 17)

Accordingly, to permit the Quality Agreement to be finalized within such period, Sutro shall provide SutroVax or its designee access to Sutro’s Facilities and records to enable SutroVax or its designee to complete an audit pursuant to Section 5.1 within [***] days after the Effective Date. (Page 21)

