Smith hereby grants to TDA the following rights (the "Rights"): 

            (a) the right to use and reuse Smith's name, voice, likeness,       facsimile signature, personal statistics, biographical information and any       reproduction or simulation thereof ("Smith's Likeness") in TDA's Golf       Instruction Related Products and on packaging for TDA's Golf Instruction       Related Products in any fashion, said grant of rights being limited to the       world (the "Contract Territory")"; 

            (b) the right to use and reuse Smith's Likeness in TDA's general       internal, non-public corporate promotional materials (such as TDA's Annual       Report), corporate advertising and in other forms of publicity; 

            (c) the right to use and reuse Smith's Likeness in and in connection       with the marketing, advertising, promoting and publicizing of TDA's Golf       Instruction Related Products, by any and all means now known or hereafter       developed; 

            (d) the exclusive right to use and reuse the results and proceeds of       the in connection with TDA's Golf Instruction Related Products; and 

            (e) with Smith's prior reasonable approval, the right to license to       third parties any of the foregoing rights but only in connection with or       directly related to the marketing and sale of TDA's Golf Instruction       Related Products. (Page 1)

Without limiting the foregoing, TDA shall, during the Term (and, Subject to the limitations and conditions on the Rights as set forth in this Agreement, thereafter) have the full and complete right to revise, telecast, broadcast, use, distribute, reproduce, record, publish, print, license, copyright and exhibit the contents of any Results and Proceeds, the Golf Instruction Related Products and any Advertising Materials and any versions or revisions thereof and, in TDA's sole discretion, the Results and Proceeds, the Golf Instruction Related Products and Advertising Materials may be make by any process, instrumentation or device now known or hereafter developed and may be made or adapted for use in any and all media now known or hereafter developed (although it is acknowledged and agreed by TDA that multi-media usage (except, of course, as incorporated into TDA's Golf Instruction Related Products) shall be strictly limited to advertising) provided that any and all such uses are directly related to the marketing, development and sale of TDA's Golf Instruction Related Products. (Page 4)

